import React from "react";
import Cable from "./Cable/Cable";

function CoaxAssemblie() {
  return (
    <>
      <div>Maak uw eigen CoaxAssemblie</div>
      <div>Order</div>
      <Cable />
      <div>ConnectorA</div>
      <div>ConnectorB</div>
      <div>Haspel</div>
      <div>Afwerking</div>
    </>
  );
}

export default CoaxAssemblie;
